import { ADD_DIARY } from '../actions/types';

const initialState = [];

const diariesReducer = (state = initialState, action) => {
    switch (action.type) {
        case ADD_DIARY:
            console.log(action);
           return [
            action.diary.data,
            ...state
           ]
        default:
            return state;
    }
}

export default diariesReducer;
